        <div class="app-main" id='recogniseAppMain'>
            <div class="main-header-line">
                <h1>Recognise American Sign Language</h1>
                <div class="action-buttons">
                    <button class="menu-button">
                        <svg xmlns="http://www.w3.org/2000/svg" width="24" height="24" viewBox="0 0 24 24" fill="none" stroke="currentColor" stroke-width="2" stroke-linecap="round" stroke-linejoin="round" class="feather feather-menu">
                            <line x1="3" y1="12" x2="21" y2="12"/>
                            <line x1="3" y1="6" x2="21" y2="6"/>
                            <line x1="3" y1="18" x2="21" y2="18"/>
                        </svg>
                    </button>
                </div>
            </div>
            <div class="main-content-container">
                <div class="main-content-wrapper big">
                    <div class="main-content">
                        <div class="main-content-header">
                            <h2>Capture the picture of your sign here</h2>
                            <span>Get set go!</span>
                        </div>
                        <div class="main-content-data">
                            <div class="camera-container">
                                <div class="camera-top">
                                    <div class="zoom"></div>
                                    <div class="mode-changer"></div>
                                    <div class="sides"></div>
                                    <div class="range-finder"></div>
                                    <div class="focus"></div>
                                    <div class="red"></div>
                                    <div class="view-finder"></div>
                                    <div class="flash">
                                        <div class="light"></div>
                                    </div>
                                </div>
                                <div class="camera-mid">
                                    <div class="sensor"></div>
                                    <div class="lens"></div>
                                </div>
                                <div class="camera-bottom"></div>
                            </div>
                        </div>
                        <button id='startCameraButton'>Start Camera and Recognise ASL</button>
                    </div>
                </div>
                <div class="main-content-wrapper small">
                    <div class="main-content">
                        <div class="main-content-header">
                            <h2>Control Panel</h2>
                            <span href="#">ASL to Text</span>
                        </div>
                        <div style='width:100%'>
                            <table id='controlPanelTable'>
                                <tr>
                                    <td style="width:15%;">Character:</td>
                                    <td style="text-align:center;" id='controlPanelCharacter'>-</td>
                                </tr>
                                <tr>
                                    <td style="width:15%;">Word:</td>
                                    <td style="text-align:center;" id='controlPanelWord'>-</td>
                                </tr>
                                <tr>
                                    <td style="width:15%;">Sentence:</td>
                                    <td style="text-align:center;" id='controlPanelSentence'>-</td>
                                </tr>
                            </table>
                            <button id='moveSentenceButton'>Move the sentence generated to Notepad</button>
                        </div>
                    </div>
                    <div class="main-content">
                        <div class="main-content-header">
                            <h2>Notepad</h2>
                            <span>Text to Speech</span>
                        </div>
                        <div style='width:100%'>
                            <p id="warning" style="display:none;">Sorry, your web browser does not support the Speech Synthesis API</p>
                            <form id='speak'>
                                <textarea id='speakText' class='autoExpand' rows='3' data-min-rows='3' placeholder='The Text recognised from ASL can be moved here ' autofocus></textarea>
                                <select id="voiceOptions">
                                    <option data-lang="en-IN" data-name="Microsoft Heera - English (India)">Microsoft Heera - English (India)</option>
                                    <option data-lang="en-IN" data-name="Microsoft Ravi - English (India)">Microsoft Ravi - English (India)</option>
                                </select>
                                <button type='submit' id='speakButton'>Speak</button>
                            </form>
                        </div>
                    </div>
                </div>
            </div>
        </div>
        <div class="app-main" id='dictionaryAppMain' style='display:none;'>
            <div class="main-header-line">
